import React from 'react';
import logo from './logo.svg';
import './App.css';
import "./style.css";
import Logo from './beaubi_logo_blue.png';
import { useForm } from 'react-hook-form';



export default function App() {
  const { register, handleSubmit, errors } = useForm();
  const onSubmit = data => console.log(data);
  console.log(errors);

  return (
    <form onSubmit={handleSubmit(onSubmit)}>

<Navbar>
  <Navbar.Brand href="#home">Navbar with text</Navbar.Brand>
  <Navbar.Toggle />
  <Navbar.Collapse className="justify-content-end">
    <Navbar.Text>
      Signed in as: <a href="#login">Mark Otto</a>
    </Navbar.Text>
  </Navbar.Collapse>
</Navbar>

  <img src={Logo} alt='logo'width="90" height="30" />

  <h1>Request product</h1>

  <p>Help us to build a library of products wanted by you</p>

    <label htmlFor="text">Add URL:</label>
      <input type="text" placeholder="https://www.company.com/product" name="URL"/>

  <p>Or simply add manually details of the product</p>

    <label htmlFor="text">Brand:</label>
      <input type="text" placeholder="Brand Name" name="brand"/>

    <label htmlFor="text">Product:</label>
      <input type="text" placeholder="Product name" name="product"/>

          <label htmlFor="text">Category:</label>
      <input type="text" placeholder="ex. Clenser, shampo, mascara..." name="category"/>

      <input type="submit" />
    </form>
  );
}
